*,body,html{
            margin:0;
            padding:0;

        /* >900 */
        body{
            /* position: relative; */
            /* width:
             100vw; */
    /* display: flex;
    justify-content: center */
        }

        /* <900 unset */

        .logo {
            width: 900px;
            height: 600px;
             position: relative;
            /* height: 100vh; */
        }
        .test{
            width:100%;
            height: 100%;
        }

        .test img{
            height: 100%;
            width:100%;
            object-fit: contain;
            opacity: 0;
            /* animation-delay: 13.5s; */
            animation: drawbg 1.5s 2s cubic-bezier(.21,1.02,.73,.94) forwards;
        }

        @keyframes drawbg{
            30%{  opacity: 0.2;}  
            70%{  opacity: 0.5;}
            100%{ opacity: 0.8; }
        }

        svg{
            position: absolute;
            top:0;
            left: 0;
            /* max-height:100vh; */
            /* height: 100vh; */
            width:100%;
        }
        path{
            fill:none; 
            /* stroke:rgb(153, 175, 241); */
              stroke:black;
            stroke-linecap: round;
            stroke-linejoin:round;
        }

        /* #myPath{stroke:red; stroke-width:1.5px;  
            stroke-dashoffset:calc(var(--foo) * 1px);
            transition: stroke-dashoffset 1s;
        }

        svg:hover #myPath{stroke-dashoffset:0}

        #myPathGroup path{stroke: #4a23d8;} */
        #myPath{
            transform:translate(0.000000,200.000000) scale(0.100000,-0.100000);
            fill:"#000000";
            stroke:"none";
        }

        /* transform="translate(0.000000,200.000000) scale(0.100000,-0.100000)"
fill="#000000" stroke="none" */

        #myPath path{
            /* stroke-dasharray: 450;
            stroke-dashoffset: 450;
            animation: draw 12s linear forwards;
            stroke-width: 10pt; */
            stroke-dasharray: 10000;
            stroke-dashoffset:10000;
            animation: draw 3s linear none;
            /* animation:triangle 3s step-start infinite; */
            stroke-width: 4pt;
            fill: none;
            /* fill:yellow; */
        }
        @keyframes draw {
            30% {
                /* stroke-dashoffset: 0; */
                fill:rgba(206, 200, 180, 0.2);
            }
            60% {
                /* stroke-dashoffset: 0; */
                fill:rgba(206, 200, 180, 0.4);
            }
            100% {
                stroke-dashoffset: 0;
                fill:rgba(206, 200, 180, 0.8);
            }
            /* 30%{ fill:rgba(145, 115, 18, 0.241);}
            80%{ fill:rgba(145, 115, 18, 0.541);}
            100%{ fill:rgba(145, 115, 18, 0.736);} */
        }
